import React from "react";
import {
  ResenjeContainer,
  ResenjeTitle,
  ResnjeContent,
} from "./ResenjeElements";
import { DiReact } from "react-icons/di";
import { SiSpring } from "react-icons/si";

function Resenje() {
  return (
    <>
      <ResenjeContainer id="resenje">
        <ResnjeContent>
          <ResenjeTitle>
            Front End: <DiReact /> React
          </ResenjeTitle>
          <ResenjeTitle>
            ML: <DiReact />
          </ResenjeTitle>
          <ResenjeTitle>
            Back End: <SiSpring /> Spring Framework
          </ResenjeTitle>
        </ResnjeContent>
      </ResenjeContainer>
    </>
  );
}

export default Resenje;
